import React from 'react';
import './App.css';


const App = () => {
  return (
    <div className='app-wrapper'>
      <header className='header'>
        <img src='https://www.appmachine.com/wp-content/uploads/2016/02/No-Branding-Header-Background-1.jpg'></img>  
      </header>    
      <nav className='nav'>
        <div>
          <a>Profile</a></div>
        <div>
          <a>Messages</a></div>
        <div>
          <a>News</a></div>
        <div>
          <a>Music</a></div>
      </nav>
      <div className='content'>
        <img src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQt-e24VTdLuw7ukD5MG6tbiopRlR0pPw0PRw&usqp=CAU'></img>
      </div>
      </div>
  );
}

export default App;
